import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Electronics" category card
    const electronicsCardSelector = 'div.category-card:has-text("Electronics")';
    await page.waitForSelector(electronicsCardSelector, { timeout: 5000 });
    const electronicsCard = page.locator(electronicsCardSelector);

    // Extract text from the card before clicking
    const cardText = await electronicsCard.textContent();

    await electronicsCard.click();

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_clicked_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_clicked_electronics.png'));

    return {
      success: true,
      action: "Clicked on the 'Electronics' category card.",
      extractedData: {
        clickedElementText: cardText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error_screenshot.png')],
      error: error.message
    };
  }
}
